import './dogDetail.css'
import { Link } from "react-router-dom";
import { getRaceDetail } from "../../Redux/actions";

import React, { useEffect } from "react";
import fondoDefault from '../../img/fondohome1.jpg';
import { useDispatch, useSelector } from 'react-redux';




function DogDetail(props){

const dispatch = useDispatch();
const raceDetail = useSelector(state => state.raceDetail);

const id = props.params.id;


useEffect(() =>{
dispatch(getRaceDetail(id))
}, [dispatch, id])


  return (
    <div key={id}>
    <div>
    <Link to='/home' id="click">
    <button >Volver a Home</button>
    </Link>
    </div>
        {raceDetail.length > 0}
        <div>
       <img src={raceDetail[0].image? raceDetail[0].image : fondoDefault} alt="La imagen no se encuentra"/>
       <div>
       <div className="nameDetail">{raceDetail[0].name}</div>
               <div className="tempNameDetail">Temperamentos</div>
               <div className="tempDetail">{raceDetail[0].temperament}</div>
               <div className="pesoNameDetail" >Peso</div>
               <div className="pesoDetail">{raceDetail[0].weight} kg</div>
               <div className="alturaNameDetail">Altura</div>
               <div className="alturaDetail">{raceDetail[0].height} cm </div>
               <div className="liveNameDetail">AÃ±os de vida</div>
               <div className="liveDetail">{raceDetail[0].life_span}</div>

      </div>
      : <p>Volver</p>
       </div>
    </div>
  )
}

export default DogDetail;
